import { Buffer } from 'node:buffer'
import { gunzipSync } from 'node:zlib'

const FONT_DATA_BASE64 = {
    "DejaVuSans.ttf": "",
    "DejaVuSans-Bold.ttf": "",
    "DejaVuSans-Oblique.ttf": "",
    "DejaVuSansMono.ttf": ""
} as const

export const getFontBuffer = (fileName: string) => {
    const base64 = FONT_DATA_BASE64[fileName as keyof typeof FONT_DATA_BASE64]
    if (!base64) {
        throw new Error(`Unsupported font: ${fileName}`)
    }
    return gunzipSync(Buffer.from(base64, 'base64'))
}
